<div class="register-container">
  <h2>Register</h2>
  <form #registerForm="ngForm" (ngSubmit)="register()" novalidate>
    <div class="form-group">
      <label for="creditCardNo">Credit Card Number</label>
      <input
        type="text"
        id="creditCardNo"
        [(ngModel)]="creditCardNo"
        name="creditCardNo"
        required
      />
      <span class="errorClass" *ngIf="!creditCardNo"
        >Credit Card Number is required</span
      >
    </div>

    <div class="form-group">
      <label for="email">Email</label>
      <input
        type="email"
        id="email"
        [(ngModel)]="email"
        name="email"
        required
      />
      <span class="errorClass" *ngIf="!email">Email is required</span>
      <span class="errorClass" *ngIf="email && !isEmailValid()"
        >Invalid email format</span
      >
    </div>

    <div class="form-group">
      <label for="contactPhone">Contact Phone</label>
      <input
        type="text"
        id="contactPhone"
        [(ngModel)]="contactPhone"
        name="contactPhone"
        required
      />
      <span class="errorClass" *ngIf="!contactPhone"
        >Contact Phone is required</span
      >
    </div>

    <div class="form-group">
      <label for="sex">Sex</label>
      <select id="sex" [(ngModel)]="sex" name="sex" required>
        <option value="" disabled selected>Select</option>
        <option value="Male">Male</option>
        <option value="Female">Female</option>
      </select>
      <span class="errorClass" *ngIf="!sex">Sex is required</span>
    </div>

    <div class="form-group">
      <label for="lastName">Last Name</label>
      <input
        type="text"
        id="lastName"
        [(ngModel)]="lastName"
        name="lastName"
        required
      />
      <span class="errorClass" *ngIf="!lastName">Last Name is required</span>
    </div>

    <div class="form-group">
      <label for="firstName">First Name</label>
      <input
        type="text"
        id="firstName"
        [(ngModel)]="firstName"
        name="firstName"
        required
      />
      <span class="errorClass" *ngIf="!firstName">First Name is required</span>
    </div>

    <div class="form-group">
      <label for="securityA">Security Answer</label>
      <input
        type="text"
        id="securityA"
        [(ngModel)]="securityA"
        name="securityA"
        required
      />
      <span class="errorClass" *ngIf="!securityA"
        >Security Answer is required</span
      >
    </div>

    <div class="form-group">
      <label for="securityQ">Security Question</label>
      <input
        type="text"
        id="securityQ"
        [(ngModel)]="securityQ"
        name="securityQ"
        required
      />
      <span class="errorClass" *ngIf="!securityQ"
        >Security Question is required</span
      >
    </div>

    <div class="form-group">
      <label for="password">Password</label>
      <input
        type="password"
        id="password"
        [(ngModel)]="password"
        name="password"
        required
      />
      <span class="errorClass" *ngIf="!password">Password is required</span>
    </div>

    <div class="form-group">
      <label for="username">Username</label>
      <input
        type="text"
        id="username"
        [(ngModel)]="username"
        name="username"
        required
      />
      <span class="errorClass" *ngIf="!username">Username is required</span>
    </div>
    <div class="form-group">
      <label for="address">Address</label>
      <input
        type="text"
        id="address"
        [(ngModel)]="address"
        name="address"
        required
      />
      <span class="errorClass" *ngIf="!address">Address is required</span>
    </div>
    <div class="form-group">
      <label for="profilePicture">Profile Picture</label>
      <input
        type="file"
        id="profilePicture"
        (change)="onFileSelected($event)"
        name="profilePicture"
      />
    </div>

    <button type="submit" [disabled]="!registerForm.valid">Register</button>
    <span class="errorClass">{{ message }}</span>
  </form>
</div>
